import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import GlobalStyles from './styles/GlobalStyles';
import { handleNavClick } from './utils/smoothScroll';

const AppContainer = styled.div`
  min-height: 100vh;
  background: #0a0a0a;
  color: #fff;
  overflow-x: hidden;
  display: flex;
  flex-direction: column;
`;

const Navigation = styled.nav`
  position: fixed;
  top: 0;
  right: 0;
  padding: 2rem;
  z-index: 100;

  ul {
    display: flex;
    gap: 2rem;
    list-style: none;
  }

  a {
    color: #fff;
    text-decoration: none;
    font-size: 1.1rem;
    position: relative;
    
    &:after {
      content: '';
      position: absolute;
      bottom: -5px;
      left: 0;
      width: 0;
      height: 2px;
      background: linear-gradient(135deg, #ffd700, #00ffff);
      transition: width 0.3s ease;
    }

    &:hover:after {
      width: 100%;
    }
  }
`;

const MainContent = styled.main`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 2rem;
`;

const Section = styled.section`
  min-height: 100vh;
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 4rem 0;
`;

const HeroSection = styled(Section)`
  text-align: center;
`;

const HeroContent = styled(motion.div)`
  max-width: 800px;

  h1 {
    font-size: 4rem;
    margin-bottom: 1rem;
    background: linear-gradient(135deg, #ffd700, #00ffff);
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
  }

  h2 {
    font-size: 2rem;
    margin-bottom: 2rem;
    color: #888;
  }

  p {
    font-size: 1.2rem;
    line-height: 1.6;
    color: #aaa;
    margin-bottom: 2rem;
  }
`;

const AboutSection = styled(Section)`
  background: #111;
`;

const ExperienceSection = styled(Section)`
  background: #0d0d0d;
`;

const ProjectsSection = styled(Section)`
  background: #111;
`;

const ContactSection = styled(Section)`
  background: #0d0d0d;
`;

const SectionContent = styled(motion.div)`
  max-width: 800px;
  
  h2 {
    font-size: 2.5rem;
    margin-bottom: 2rem;
    background: linear-gradient(135deg, #ffd700, #00ffff);
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
  }

  p {
    font-size: 1.2rem;
    line-height: 1.6;
    color: #aaa;
    margin-bottom: 1.5rem;
  }
`;

const App: React.FC = () => {
  return (
    <>
      <GlobalStyles />
      <AppContainer>
        <Navigation>
          <ul>
            <li><a href="#home" onClick={handleNavClick}>Home</a></li>
            <li><a href="#about" onClick={handleNavClick}>About</a></li>
            <li><a href="#experience" onClick={handleNavClick}>Experience</a></li>
            <li><a href="#projects" onClick={handleNavClick}>Projects</a></li>
            <li><a href="#contact" onClick={handleNavClick}>Contact</a></li>
          </ul>
        </Navigation>

        <MainContent>
          <HeroSection id="home">
            <HeroContent
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8 }}
            >
              <h1>Yassir Rzigui</h1>
              <h2>AI Development Specialist</h2>
              <p>
                Passionate about creating intelligent solutions and pushing the boundaries
                of what's possible with artificial intelligence. Specializing in machine
                learning, deep learning, and quality assurance to build robust and
                innovative applications.
              </p>
            </HeroContent>
          </HeroSection>

          <AboutSection id="about">
            <SectionContent
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8 }}
              viewport={{ once: true }}
            >
              <h2>About Me</h2>
              <p>
                With a strong foundation in AI and machine learning, I've dedicated my career
                to developing cutting-edge solutions that make a real impact. My expertise
                spans across various domains of artificial intelligence, from natural
                language processing to computer vision.
              </p>
              <p>
                I believe in creating AI solutions that are not just technically sound but
                also ethical and user-friendly. My approach combines technical expertise
                with a deep understanding of business needs.
              </p>
            </SectionContent>
          </AboutSection>

          <ExperienceSection id="experience">
            <SectionContent
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8 }}
              viewport={{ once: true }}
            >
              <h2>Experience</h2>
              <p>
                Throughout my career, I've had the opportunity to work on diverse projects
                that have shaped my expertise in AI development. From implementing machine
                learning models to developing quality assurance frameworks, each experience
                has contributed to my growth as a specialist.
              </p>
            </SectionContent>
          </ExperienceSection>

          <ProjectsSection id="projects">
            <SectionContent
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8 }}
              viewport={{ once: true }}
            >
              <h2>Projects</h2>
              <p>
                Here are some of the key projects I've worked on, demonstrating my
                capabilities in AI development and problem-solving. Each project represents
                a unique challenge and innovative solution.
              </p>
            </SectionContent>
          </ProjectsSection>

          <ContactSection id="contact">
            <SectionContent
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8 }}
              viewport={{ once: true }}
            >
              <h2>Contact</h2>
              <p>
                I'm always interested in hearing about new projects and opportunities.
                Whether you have a question or just want to say hi, feel free to reach
                out!
              </p>
            </SectionContent>
          </ContactSection>
        </MainContent>
      </AppContainer>
    </>
  );
};

export default App;
